svg.script:


var svgDialog = "svgDialog";
var currentDialog = "ShowHideDialog";

var dialogTitles =
	{
		1:'Introduzione',
		2:'Chiostro Grande',
		3:'Parlatorio',
		4:'Capitolo',
		5:'Coro',
		6:'Tesoro Nuovo'
	};
var audioguidaSize = Object.keys(dialogTitles).length;

var dialogDescriptions =
	{
		1:'La chiesa è uno dei luoghi simbolo del barocco napoletano',
		2:'Faccio una prova che più o meno è lunga come la precedente',
		3:'Questa è la sezione del parlatorio e quindi scrivo le cose',
		4:'',
		5:'',
		6:''
	};

	var dialogPosX =
	{
		1:'283',
		2:'19',
		3:'63',
		4:'65',
		5:'67',
		6:'67'
	};

var dialogPosY =
	{
		1:'231',
		2:'0',
		3:'55',
		4:'157',
		5:'232',
		6:'420'
	};

	function pin_click(id) {
		let currentID = splitID(id);
		initDialogStyle();
		pinellipse = id+"e";
		pintxt = id+"txt";
		let currentPin = document.getElementById(pinellipse);
		let currentPinTxt = document.getElementById(pintxt);
		let currentFill = currentPin.style.fill;
		let currentPinTxtFill = currentPinTxt.style.fill;
		let currentPinTxtRgbToHex = rgbToHex(currentPinTxtFill);
		if (currentPinTxtRgbToHex==="#ffffff"){
			currentPin.style.fill = currentPinTxtFill;
			currentPinTxt.style.fill = currentFill;
			setDialogColors(currentFill);
			showDialogFromID(currentID);
		}
		else{
			//TODO scegliere tipo di interazione
			Android.showToast("Hai già visitato questa stanza, la vuoi rivisitare?");
		}
	}

	function splitID(id){
		let splitID = id.split("n");
		let finalID = splitID[1];
	return finalID;
	}

	function initDialogStyle(){
		var dialog = document.getElementById("dialog");
		let defaultFillValue = dialog.style.fill;

		document.getElementById(currentDialog).style.display = "none";
		document.getElementById("dialogtitle").style.fill = defaultFillValue;
		document.getElementById("dialogVisitaStanza").style.fill = defaultFillValue;

	}

	function setDialogColors(currentFill){
		document.getElementById("dialog").style.stroke = currentFill;
		document.getElementById("dialogHeader").style.fill = currentFill;
		document.getElementById("dialogHeader").style.stroke = currentFill;
		document.getElementById("dialogButton").style.fill = currentFill;
		document.getElementById("dialogButton").style.stroke = currentFill;
	}

	function showDialogFromID(id){

		setDialogContentFromID(id);
		let style = document.getElementById(currentDialog).style.display;
		if (style=="none"){
			document.getElementById(currentDialog).style.display = "block";
		}
		else {
				document.getElementById(currentDialog).style.display = "none";
		}


	}

	function setDialogContentFromID(id){

		currentPosX = dialogPosX[id];
		currentPosYX = dialogPosY[id];

		document.getElementById(svgDialog).setAttribute('x', dialogPosX[id]);
		document.getElementById(svgDialog).setAttribute('y', dialogPosY[id]);

		let currentTitle = dialogTitles[id];
		let dialogTitle = document.getElementById("dialogtitle");
		dialogTitle.textContent = currentTitle;


		setDialogDescriptionContentFromID(id);

	}

	function setDialogDescriptionContentFromID(id){
		let tFirstSpanDescriptions =
		{
			1:'La chiesa è uno dei luoghi simbolo',
			2:'Faccio una prova che più o meno è ',
			3:'Questa è la sezione del parlatorio',
			4:'',
			5:'',
			6:''
		};
		let tSecondSpanDescriptions =
		{
			1:'del barocco napoletano',
			2:'lunga come la precedente',
			3:'e quindi scrivo le cose',
			4:'',
			5:'',
			6:''
		};

		let currentFirstDescription = tFirstSpanDescriptions[id];
		let currentSecondDescription = tSecondSpanDescriptions[id];

		let tSpanFirst = document.getElementById("tspanfirst");
		let tSpanSecond = document.getElementById("tspansecond");
		let tFirstSpanDescription = document.getElementById("tspanfirst");
		let tSecondSpanDescription = document.getElementById("tspansecond");
		tFirstSpanDescription.textContent = currentFirstDescription;
		tSecondSpanDescription.textContent = currentSecondDescription;
	}

	function rgbToHex(color) {
		color = ""+ color;
		if (!color || color.indexOf("rgb") < 0) {
			return;
		}

		if (color.charAt(0) == "#") {
			return color;
		}

		let nums = /(.*?)rgb\((\d+),\s*(\d+),\s*(\d+)\)/i.exec(color),
			r = parseInt(nums[2], 10).toString(16),
			g = parseInt(nums[3], 10).toString(16),
			b = parseInt(nums[4], 10).toString(16);

		return "#"+ (
			(r.length == 1 ? "0"+ r : r) +
			(g.length == 1 ? "0"+ g : g) +
			(b.length == 1 ? "0"+ b : b)
		);
	}


	function openActivity(){


		let x = document.getElementById(svgDialog);
		let y = document.getElementById(svgDialog);

		let posX = parseFloat(x.getAttribute("x"));
		let posY = parseFloat(y.getAttribute("y"));

		for (i=1;i<=audioguidaSize;i++){
			let parsePosX = parseFloat(dialogPosX[i]);
			let parsePosY = parseFloat(dialogPosY[i]);
			if (parsePosX==posX && parsePosY==posY){
				let dialogTitle = document.getElementById("dialogtitle");
				let currentTitleFill = dialogTitle.style.fill;
				let dialogHeader = document.getElementById("dialogHeader");
				let currentHeaderFill = dialogHeader.style.fill;
				document.getElementById("dialogVisitaStanza").style.fill = currentHeaderFill;
				document.getElementById("dialogButton").style.fill = currentTitleFill;
				let id = i;
				let startActivity = "Navigation://OpenNativeScreen_"+id;
				window.location = startActivity;
			}
		}
	}

	function hideDialog(){
		document.getElementById(currentDialog).style.display='none'
	}
